import '../css/footer.css';

function Footer({ items }) {
  return (
    <div className="footerWrapper">
      <div style={{ color: 'red' }}>Total Item: {items.length}</div>
      <br />
      <div style={{ color: 'blue' }}>Completed Item: {items.filter(item => item.packed).length}</div>
    </div>
  );
}

export default Footer;
